import './Header.css';

function Header() {
  return (
    <div>
    <div className='header'>
      <div>
      <h1>Lost-'N-Found</h1>
      </div>
      <h2>Lost it? Let's find it</h2>
    </div>
    </div>
  );
}

export default Header
